import React from "react";
import ReactDOM from "react-dom";
import App from "./App";
import reportWebVitals from "./reportWebVitals";
import { ContextProvider } from "./context/Context";

ReactDOM.render(
  <React.StrictMode>
    <React.Fragment>
    <ContextProvider>
      <App />
    </ContextProvider>
    </React.Fragment>
  </React.StrictMode>,
  document.getElementById("root")
);

reportWebVitals();
